import React from 'react';
import './App.css';
import List from '@material-ui/core/List';
import { mainListItems, secondaryListItems } from './Components/elementos';

import Title from './Components/title';

function App() {
  return (
    <div className="App">
      <Title children="este es el titulo"/>
      <List>{mainListItems}</List>
      <List>{secondaryListItems}</List>
    </div>
  );
}

export default App;
